import { Routes,Route } from "react-router-dom";
import Auth from "../src/pages/Auth/Auth";
import Home from "../src/pages/Home/Home"


const AllRoutes = () => {
    return (
        <div>
            <Route  path='/' component={Home} />
            <Route  path='/Auth' component={Auth}/> 
        </div>
    );
};

export default Routes;
